"use strict";

function areNumbersAscending(s) {
    let curr = 0;
    for (let t of s.split(' ')) {
        if (t[0].match(/\d/)) {
            if (curr >= parseInt(t)) {
                return false;
            }
            curr = parseInt(t);
        }
    }
    return true;
}
